/**
 * @ngdoc directive
 * @name materialIcon
 * @module material.components.icon
 *
 * @restrict E
 *
 * @description
 * The `<material-icon>` directive is an element useful for SVG icons
 *
 * @usage
 * <hljs lang="html">
 *  <material-icon icon="/img/icons/ic_access_time_24px.svg">
 *  </material-icon>
 * </hljs>
 *
 */
function materialIconDirective() {
  return {
    restrict: 'E',
    template: '<object class="material-icon"></object>',
    compile: function(element, attr) {
      var object = angular.element(element[0].children[0]);
      if(angular.isDefined(attr.icon)) {
        object.attr('data', attr.icon);
      }
    }
  };
}

/**
 * @ngdoc directive
 * @name materialIconCore
 * @module material.components.icon
 *
 * @restrict E
 *
 * @description
 * The `<material-icon-core>` directive is an element useful for SVG icons
 *
 * @usage
 * <hljs lang="html">
 *  <material-icon-core icon-name="work" icon-size="40"></material-icon-core>
 *  </material-icon>
 * </hljs>
 *
 */
function materialIconCoreDirective(materialIconSet) {
    return {
        restrict: 'E',
        replace: false,
        link: function(scope, element, attr)
        {
            var object = angular.element(element[0]);
            var icon = angular.element(materialIconSet[attr.iconName]);
            icon.attr('viewBox', "0 0 24 24");
            icon.attr('width', attr.iconSize);
            icon.attr('width', attr.iconSize);
            object.append(icon);
        }
    };
}

